Expired Date 28 Agustus 2022



BERAT BERSIH = 200 gram



Short Steam, Premium Quality, Baunya harum dan terasa,



Sencha adalah teh hijau yang paling populer di Jepang, mewakili sekitar 80 persen dari teh yang diproduksi di Jepang. Rasanya yang ringan dan menyegarkan menjadikannya dapat dinikmati pada setiap suasana. Warna ideal dari minuman teh sencha adalah warna kuning emas untuk sencha jenis short steam dan hijau untuk sencha jenis deep steam



Manfaat pada Japanese Tea antara lain :

- Sumber antioksidan dan vitamin C yang tinggi;

- Menurunkan kolesterol dan menjaga tekanan darah;

- Membantu proses pembakaran lemak;

- Mencegah dan menghancurkan sel-sel kanker;

- Mencegah serangan jantung dan penyumbatan arteri;

- Penghalau stress dan mengendurkan syaraf;

- Mencegah bau mulut dan kerusakan gigi;

- Melindungi dari penyakit Diabetes dan Hepatitis;

- Mencegah influenza, pilek, dan batuk;

- Memperkuat sistem imun tubuh;

- Mencegah penyakit Demensia dan Amnesia;

- Meredakan gejala menopause dan gangguan tidur;

- Membuat kulit bersinar, rambut sehat, dan mengurangi tanda-tanda penuaan.



Saran Penyajian :

- Gunakan perbandingan 1gram teh sama dengan 70ml air

- Seduh teh sencha dengan air hangat (80' C)

- Tunggu hingga 1,5 - 3 menit dan Teh siap untuk diminum



PERHATIAN

- Teh dapat diseduh sampai dengan 3x

- Jangan gunakan air mendidih / terlalu panas, karena akan merusak kandungan nutrisi dalam teh dan akan membuat teh menjadi pahit sehingga kehilangan aroma aslinya

- Simpan di tempat yang bersih, gelap, kering dan sejuk.

- Jika konsumsi sesudah makan, beri jeda 10 sd 15 menit.
